histogramDefault_id100(256, :) = sum(histogram_i255k_id100);
histogramDefault_id100(2:255, 256) = (sum(histogram_ij255_id100(:, 2:255))).';

% Set the format to longe to capture the differences in the experimental probabilities
format longe

